Queen Sonja #33
Publisher:  Dynamite Entertainment
Publication Date:  January 2, 2013

Written by Luke Lieberman
Art by Milton Estevam
Colors by Salvatore Aiala Studio
Letters by Simon Bowland
Cover by Lucio Parrillo

Atlantis Resurrected! Even as five armies converge on Emora, Thulsa Doom returns, and brings the Atlantean Empire with him. Sonja must prove her innocence for the string of royal assassinations that occurred during her tournament, and try to bring the armies of the region together to repel the advancing Atlanteans.

